using ContactApi.Data;
using ContactApi.Models;
using Microsoft.EntityFrameworkCore;
using Microsoft.Extensions.DependencyInjection;
using Microsoft.Extensions.Logging;
using System;
using System.Linq;
using System.Threading.Tasks;

namespace ContactApi.Services
{
    public class DataSeederService
    {
        private readonly IServiceProvider _serviceProvider;
        private readonly ILogger<DataSeederService> _logger;

        public DataSeederService(IServiceProvider serviceProvider, ILogger<DataSeederService> logger)
        {
            _serviceProvider = serviceProvider;
            _logger = logger;
        }

        public async Task SeedAsync(int numberOfEntries)
        {
            using (var scope = _serviceProvider.CreateScope())
            {
                var context = scope.ServiceProvider.GetRequiredService<ContactContext>();

                if (await context.Contacts.AnyAsync())
                {
                    _logger.LogInformation("Database already seeded.");
                    return;
                }

                _logger.LogInformation("Seeding database...");

                var names = new[] { "John Doe", "Jane Smith", "Alice Johnson", "Bob Brown", "Charlie Davis", "Dana White", "Eve Black", "Frank Green", "Grace Harris", "Hank Moore", "Ivy Adams", "Jack Wilson", "Karen Thomas", "Leo Scott", "Megan Hall", "Nick Young", "Olivia King", "Paul Allen", "Quinn Baker", "Rachel Martinez" };
                var emails = new[] { "john@example.com", "jane@example.com", "alice@example.com", "bob@example.com", "charlie@example.com", "dana@example.com", "eve@example.com", "frank@example.com", "grace@example.com", "hank@example.com", "ivy@example.com", "jack@example.com", "karen@example.com", "leo@example.com", "megan@example.com", "nick@example.com", "olivia@example.com", "paul@example.com", "quinn@example.com", "rachel@example.com" };
                var addresses = new[] { "123 Street", "456 Avenue", "789 Boulevard", "101 Road", "102 Street", "103 Avenue", "104 Boulevard", "105 Road", "106 Street", "107 Avenue", "108 Boulevard", "109 Road", "110 Street", "111 Avenue", "112 Boulevard", "113 Road", "114 Street", "115 Avenue", "116 Boulevard", "117 Road" };
                var countries = new[] { "UK", "USA", "Canada", "Australia", "Germany" };
                var pincodes = new[] { "456224", "456225", "456226", "456227", "456228", "456229", "456230", "456231", "456232", "456233", "456234", "456235", "456236", "456237", "456238", "456239", "456240", "456241", "456242", "456243" };

                var random = new Random();

                var contacts = Enumerable.Range(0, numberOfEntries).Select(index => new Contact
                {
                    Name = names[random.Next(names.Length)],
                    Email = emails[random.Next(emails.Length)],
                    Phone = GenerateRandomPhoneNumber(random),
                    Image = GetSampleImage(index + 1),
                    ContactDetail = new ContactDetail
                    {
                        Address = addresses[random.Next(addresses.Length)],
                        Country = countries[random.Next(countries.Length)],
                        Pincode = pincodes[random.Next(pincodes.Length)]
                    }
                }).ToArray();

                context.Contacts.AddRange(contacts);
                await context.SaveChangesAsync();

                _logger.LogInformation("Database seeded successfully.");
            }
        }

        private string GenerateRandomPhoneNumber(Random random)
        {
            // Generate a 10-digit phone number
            return $"0{random.Next(100000000, 999999999)}";
        }

        private string GetSampleImage(int imageNumber)
        {
            // Base64-encoded 1x1 pixel PNG images
            var base64Template1 = "data:image/png;base64,";

            var base64Template2 = "data:image/png;base64,";

            Random random = new Random();
            int randomNumber = random.Next(1, 3); // Returns 1 or 2

            // Select the appropriate base64 string based on the random number generated
            var base64Unique = randomNumber == 1 ? base64Template1 : base64Template2;


            // Return the data URI
            return $"{base64Unique}";
        }


    }
}
